import React from "react";
import { FaPlus } from 'react-icons/fa'

import "./Form.css"

export default function Form({hundleSubmit, hundleInput, newTask}) {
    return (
        <form className="form" action="#" onSubmit={props.hundleSubmit}>
            <input
            onChange={props.hundleInput}
            type="text"
            value={props.newTask}
            ></input>
            <button type="submit">
            <FaPlus/>
            </button>
        </form>

    )
}
